import React from "react";
import styles from './Users.module.css';

let Users = (props) => {

    if (props.users.length === 0) {
        props.setUsers([
            {
                id: 1,
                photoUrl: 'data:image/jpeg;base64,',
                followed: false,
                fullName: 'Nastya',
                status: 'Full',
                location: {
                    city: 'Lviv', country: 'Ukraine'
                }
            },
            {
                id: 2,
                photoUrl: 'data:image/jpeg;base64,',
                followed: false,
                fullName: 'Katya',
                status: 'Good',
                location: {
                    city: 'Kosice', country: 'Slovakia'
                }
            },
            {
                id: 3,
                photoUrl: 'data:image/jpeg;base64,',
                followed: true,
                fullName: 'Stefan',
                status: ' Online',
                location: {
                    city: 'Uzhhorod', country: 'Ukraine'
                }
            }
        ])
    }
    return <div>
        {
            props.users.map(u => <div key={u.id}>
                <span>
                    <div><img src={u.photoUrl} className={styles.userPhoto}/></div>
                    <div>
                        {u.followed
                            ? <button onClick={() => {
                                props.unfollow(u.id)
                            }}>Unfollow</button>
                            : <button onClick={() => {
                                props.follow(u.id)
                            }}>Follow</button>
                        }</div>
                </span>
                    <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div>{u.location.city}</div>
                        <div>{u.location.country}</div>
                    </span>
                </span>

                </div>
            )
        }
    </div>
}
export default Users;